import React from "react";
import { useParams } from "react-router-dom";
import { Card, CardContent, Toolbar, Typography } from "@material-ui/core";
import { Box } from "@material-ui/system";
import useFetch from "../useFetch";

function Details() {
  const id = useParams();

  const [todos] = useFetch(id);

  return (
    <Box
      component="main"
      sx={{
        flexGrow: 1,
        bgcolor: "background.default",
        p: 3,
      }}
    >
      <Toolbar />
      <Card sx={{ mt: 10 }}>
        <CardContent>
          <Typography variant="h5" component="div">
            Title
          </Typography>
          <Typography sx={{ mb: 1.5 }} color="text.secondary">
            Type
          </Typography>
          <Typography variant="body2" sx={{ mt: 2, fontSize: "1.3rem" }}>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Tenetur
            nobis consequatur commodi sapiente esse temporibus id perferendis,
            numquam sunt quae fuga magni a cum officiis quam omnis. In, quisquam
            voluptatibus.
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
}

export default Details;
